import React from "react";
import NavBar from "../components/NavBar";
import { Component } from "react";

class Gestion extends Component {

  constructor(props) {
    super(props)

    this.state = {
      message:"",
      classe:"",
       nom:"",
       prenom:"",
       date:"",
       lieuNais:"",
       lieuResi:"",
       sexe:"",
       autre:"",
       nomP:"",
       proP:"",
       telP:"",
       mailP:"",
       villeP:"",
       nomM:"",
       proM:"",
       telM:"",
       mailM:"",
       villeM:""
    };

  }

  handleChangeNom = (event) => {
    this.setState({ nom: event.target.value });
  };
  handleChangeClasse = (event) => {
    this.setState({ classe: event.target.value });
  };
  handleChangePrenom = (event) => {
    this.setState({ prenom: event.target.value });
  };
  handleChangeDate = (event) => {
    this.setState({ date: event.target.value });
  };
  handleChangeLieuNais = (event) => {
    this.setState({ lieuNais: event.target.value });
  };
  handleChangeLieuResi = (event) => {
    this.setState({ lieuResi: event.target.value });
  };
  handleChangeSexe = (event) => {
    this.setState({ sexe: event.target.value });
  };
  handleChangeAutre = (event) => {
    this.setState({ autre: event.target.value });
  };
  handleChangeNomM = (event) => {
    this.setState({ nomM: event.target.value });
  };
  handleChangeProM = (event) => {
    this.setState({ proM: event.target.value });
  };
  handleChangeTelM = (event) => {
    this.setState({ telM: event.target.value });
  };
  handleChangeMailM = (event) => {
    this.setState({ mailM: event.target.value });
  };
  handleChangeVilleM = (event) => {
    this.setState({ villeM: event.target.value });
  };
  handleChangeNomP = (event) => {
    this.setState({ nomP: event.target.value });
  };
  handleChangeProP = (event) => {
    this.setState({ proP: event.target.value });
  };
  handleChangeTelP = (event) => {
    this.setState({ telP: event.target.value });
  };
  handleChangeMailP = (event) => {
    this.setState({ mailP: event.target.value });
  };
  handleChangeVilleP = (event) => {
    this.setState({ villeP: event.target.value });
  };

  handleSubmit = (event) => {
    this.setState({message:<p>votre nom est {this.state.nom} {this.state.prenom}, nee le : {this.state.date} a {this.state.lieuNais}  vous souhaitez vous inscrire en classe de {this.state.classe} <br/> votre mere est : {this.state.nomM} {this.state.proM} et vous vivez a {this.state.lieuResi}</p>})
    event.preventDefault();
  }

  render () {
  return (
    <section>
	<section id="sidebar">
		<a href="#" class="brand">
			<i class='bx bxs-smile'></i>
			<span class="text">AdminHub</span>
		</a>
		<ul class="side-menu top">
			<li class="active">
				<a href="#">
					<i class='bx bxs-dashboard' ></i>
					<span class="text">Dashboard</span>
				</a>
			</li>
			<li>
				<a href="#">
					<i class='bx bxs-shopping-bag-alt' ></i>
					<span class="text">My Store</span>
				</a>
			</li>
			<li>
				<a href="#">
					<i class='bx bxs-doughnut-chart' ></i>
					<span class="text">Analytics</span>
				</a>
			</li>
			<li>
				<a href="#">
					<i class='bx bxs-message-dots' ></i>
					<span class="text">Message</span>
				</a>
			</li>
			<li>
				<a href="#">
					<i class='bx bxs-group' ></i>
					<span class="text">Team</span>
				</a>
			</li>
		</ul>
		<ul class="side-menu">
			<li>
				<a href="#">
					<i class='bx bxs-cog' ></i>
					<span class="text">Settings</span>
				</a>
			</li>
			<li>
				<a href="#" class="logout">
					<i class='bx bxs-log-out-circle' ></i>
					<span class="text">Logout</span>
				</a>
			</li>
		</ul>
	</section>

	<section id="content">
		<nav>
			<i class='bx bx-menu' ></i>
			<a href="#" class="nav-link">Categories</a>
			<form action="#">
				<div class="form-input">
					<input type="search" placeholder="Search..." />
					<button type="submit" class="search-btn"><i class='bx bx-search' ></i></button>
				</div>
			</form>
			<input type="checkbox" id="switch-mode" hidden /> 
			<label for="switch-mode" class="switch-mode"></label>
			<a href="#" class="notification">
				<i class='bx bxs-bell' ></i>
				<span class="num">8</span>
			</a>
			<a href="#" class="profile">
				<img src="img/people.png" />
			</a>
		</nav>
		<main>
			<div class="head-title">
				<div class="left">
					<h1>Dashboard</h1>
					<ul class="breadcrumb">
						<li>
							<a href="#">Dashboard</a>
						</li>
						<li><i class='bx bx-chevron-right' ></i></li>
						<li>
							<a class="active" href="#">Home</a>
						</li>
					</ul>
				</div>
				<a href="#" class="btn-download">
					<i class='bx bxs-cloud-download' ></i>
					<span class="text">Download PDF</span>
				</a>
			</div>

			<ul class="box-info">
				<li>
					<i class='bx bxs-calendar-check' ></i>
					<span class="text">
						<h3>1020</h3>
						<p>New Order</p>
					</span>
				</li>
				<li>
					<i class='bx bxs-group' ></i>
					<span class="text">
						<h3>2834</h3>
						<p>Visitors</p>
					</span>
				</li>
				<li>
					<i class='bx bxs-dollar-circle' ></i>
					<span class="text">
						<h3>$2543</h3>
						<p>Total Sales</p>
					</span>
				</li>
			</ul>


			<div class="table-data">
				<div class="order">
					<div class="head">
						<h3>Recent Orders</h3>
						<i class='bx bx-search' ></i>
						<i class='bx bx-filter' ></i>
					</div>
					<table>
						<thead>
							<tr>
								<th>User</th>
								<th>Date Order</th>
								<th>Status</th>
							</tr>
						</thead>
						<tbody>
							<tr>
								<td>
									<img src="img/people.png" />
									<p>John Doe</p>
								</td>
								<td>01-10-2021</td>
								<td><span class="status completed">Completed</span></td>
							</tr>
							<tr>
								<td>
									<img src="img/people.png" />
									<p>John Doe</p>
								</td>
								<td>01-10-2021</td>
								<td><span class="status pending">Pending</span></td>
							</tr>
							<tr>
								<td>
									<img src="img/people.png" />
									<p>John Doe</p>
								</td>
								<td>01-10-2021</td>
								<td><span class="status process">Process</span></td>
							</tr>
							<tr>
								<td>
									<img src="img/people.png" />
									<p>John Doe</p>
								</td>
								<td>01-10-2021</td>
								<td><span class="status pending">Pending</span></td>
							</tr>
							<tr>
								<td>
									<img src="img/people.png" />
									<p>John Doe</p>
								</td>
								<td>01-10-2021</td>
								<td><span class="status completed">Completed</span></td>
							</tr>
						</tbody>
					</table>
				</div>
				<div class="todo">
					<div class="head">
						<h3>Todos</h3>
						<i class='bx bx-plus' ></i>
						<i class='bx bx-filter' ></i>
					</div>
					<ul class="todo-list">
						<li class="completed">
							<p>Todo List</p>
							<i class='bx bx-dots-vertical-rounded' ></i>
						</li>
						<li class="completed">
							<p>Todo List</p>
							<i class='bx bx-dots-vertical-rounded' ></i>
						</li>
						<li class="not-completed">
							<p>Todo List</p>
							<i class='bx bx-dots-vertical-rounded' ></i>
						</li>
						<li class="completed">
							<p>Todo List</p>
							<i class='bx bx-dots-vertical-rounded' ></i>
						</li>
						<li class="not-completed">
							<p>Todo List</p>
							<i class='bx bx-dots-vertical-rounded' ></i>
						</li>
					</ul>
				</div>
			</div>
		</main>
	</section>
	    </section>
  );
}
}

export default Gestion;
